  utcThursdays as utcThursdays,
  utcFriday as utcFriday,
  utcFridays as utcFridays,
  utcSaturday as utcSaturday,
  utcSaturdays as utcSaturdays
} from "./src/utcWeek";

export {
  default as utcMonth,
  utcMonths as utcMonths
} from "./src/utcMonth";

export {
  default as utcYear,
  utcYears as utcYears
} from "./src/utcYear";
